        public static GemInfo GetGemInfo(int _EnchantID)
        {
            if (Values.ContainsKey(_EnchantID) == false)
                return new GemInfo { EnchantID = _EnchantID, ItemID = 32456, Name = "Unknown", Quality = 0, Color = 7};
            return Values[_EnchantID];
        }
